itionOne to positionFour, this pattern represent the binary number 0 0 0 1. TODO: Summarise using a block comment, /* */, above line 44. The next block code follows the same pattern of else if() where the boolean logic represents the binary number 0 0 1 0. else if(one == false && two == true && three == false && four == false)
