Once you have completed the circuit you will need to programme the Arduino Uno. Located above the Components click the Code > Text . Once the sketch has appeared reproduce the following code: void setup()
{ } void loop()
{ } Now you are ready to set up all the Sketch up as follows. int ledPin[8]={5,6,7,8,9,10,11,12};
char binary[9] ={0,0,0,0,0,0,0,0,'\0'}; void setup()
{ } void loop()
{ } Line 2, is an array of char with a length of 9, notice that at the end the array is \0, this is a null terminator so that the when printed to the Serial monitor it only prints the first 8 positions in the array. Setting up the void setup() we will do something a little more efficient to set the pinMode() of the ledPins array. Important note, arrays start from 0 to n. So ledPins[1] = 6 and ledPins[7] = 12. \[ \begin{matrix} Index[x] &amp; 0 &amp; 1 &amp; 2 &amp; 3 &amp; 4 &amp; 5 &amp; 6 &amp; 7\\ \hline LedPin Value &amp; 5 &amp; 6 &amp; 7 &amp; 8 &amp; 9 &amp; 10 &amp; 11 &amp; 12 \\ \end{matrix} \] Line 10, shows the initialisation of a for loop ,for(int x=0;x<8;x++), sets a variable x as 0 and while x less than 8 increment x by 1, so we can repeat the code between the {} 8 times. So you can see that as x starts at 0, ledPin[x] will set pin 5 as OUTPUT. So therefore Serial.print(ledPin[x]) outputs the value to the Serial monitor. void setup()
{ Serial.begin(9600); for(int x=0;x<8;x++) { pinMode(ledPin[x], OUTPUT); Serial.print(ledPin[x]); Serial.print(","); } Serial.println();
} The void loop(), function has little code because of the for loop and a user defined function displayBinary();. void loop()
{ for (byte counter =0;counter<=255; counter++) { displayBinary(counter); delay(500); } } QUESTION: Looking at the lines 22 to 26, describe what is happening. So now lets look at the user defined function displayBinary(); below. *Remember in earlier weeks of the course you looked at the number of bits in different data types? Notice that the expected argument in the displayBinary(byte numToShow); is the data type byte. So line 31, for(int i=0; i<8; i++) iterates over the number bits in one byte. displayBinary(counter); delay(500); }
} void displayBinary(byte numToShow)
{ for (int i =0;i<8;i++) { if (bitRead(numToShow, i)==1) { binary[7-i] = '1'; digitalWrite(ledPin[i], HIGH); } else { binary[7-i] = '0'; digitalWrite(ledPin[i], LOW); } } Serial.print("Number: "); Serial.print(numToShow); Serial.print(" | Binary: "); Serial.println(String(binary));
} Line 33, if (bitRead(numToShow, i)==1) passes the numToShow variable to the inbuilt function bitRead();. The if statement checks to see if the bit i is a 1. Line 35, binary[7-i] = '1'; sets the value at the index 7-i. Line 36, digitalWrite(ledPin[i], HIGH); sets the LED at the correct bit position to HIGH. Therefore line 38, else condition is implicitly true when (bitRead(numToShow, i)==0). Line 40, binary[7-i] = '0'; sets the value at the index 7-i. Line 41, digitalWrite(ledPin[i], LOW), sets the LED at the correct bit position to LOW. Line 44 to 47, outputs the current number numToShow and binary equivalent to the Serial monitor. As seen in image below. Below shows the output you'd expect to see for the decimal number 171. \bigcirc \[ \begin{matrix} Arduino pins &amp; 12 &amp; 11 &amp; 10 &amp; 9 &amp; 8 &amp; 7 &amp; 6 &amp; 5\\ LEDs &amp;\circledast &amp; \bigcirc &amp; \circledast &amp; \bigcirc &amp; \circledast &amp; \bigcirc &amp; \circledast &amp; \bigcirc \\ Binary &amp;1 &amp; 0 &amp; 1 &amp; 0 &amp; 1 &amp; 0 &amp; 1 &amp; 0 \\ \end{matrix} \] QUESTIONS: Look at the following documentation for bitRead() and summaries in your own words what it does: https://www.arduino.cc/reference/en/language/functions/bits-and-bytes/bitread/ Edit line 2 so that it says char binary[8] ={0,0,0,0,0,0,0,0}; and then start the simulation. What difference was there from the original output? Once tested return the code on line 2 to char binary[9] = {0,0,0,0,0,0,0,0,'\0'};. What would the output be on line 47 Serial.println(String(binary)), if lines 35 and 40 binary[7-i] is changed to binary[i]. Test your theory/answer.
